        "GettingStarted": {
            "title": "GettingStarted",
            "text": "\\define lingo-base() $:/language/ControlPanel/Basics/\n~ टिड्लीविकि और ~ टिड्लीविकि समुदाय में आपका स्वागत है\n\nआप ~ टिड्लीविकि में महत्वपूर्ण जानकारी के भंडारण शुरू करने से पहले यह तुम मज़बूती परिवर्तन बचा सकता है कि यह सुनिश्चित करना महत्वपूर्ण है। जानकारी के लिए https://tiddlywiki.com/#GettingStarted देखें\n\n!! Set up this ~TiddlyWiki\n\n<div class=\"tc-control-panel\">\n\n|<$link to=\"$:/SiteTitle\"><<lingo Title/Prompt>></$link> |<$edit-text tiddler=\"$:/SiteTitle\" default=\"\" tag=\"input\"/> |\n|<$link to=\"$:/SiteSubtitle\"><<lingo Subtitle/Prompt>></$link> |<$edit-text tiddler=\"$:/SiteSubtitle\" default=\"\" tag=\"input\"/> |\n|<$link to=\"$:/DefaultTiddlers\"><<lingo DefaultTiddlers/Prompt>></$link> |<<lingo DefaultTiddlers/TopHint>><br> <$edit-text tag=\"textarea\" tiddler=\"$:/DefaultTiddlers\"/><br>//<<lingo DefaultTiddlers/BottomHint>>// |\n</div>\n\nSee the [[control panel|$:/ControlPanel]] for more options.\n"
        },
        "$:/language/Help/build": {
            "title": "$:/language/Help/build",
            "description": "स्वचालित रूप से कॉन्फ़िगर आदेश चलाएँ",
            "text": "वर्तमान विकी के लिए निर्दिष्ट बिल्ड लक्ष्य बनाएँ। कोई बिल्ड लक्ष्य तो निर्दिष्ट कर रहे हैं सभी उपलब्ध लक्ष्य बनाया जाएगा।\n\n`` `\n--build <लक्ष्य> [<लक्ष्य> ...]\n`` `\n\nबनाएँ लक्ष्य एक विकी फ़ोल्डर की `tiddlywiki.info` फाइल में परिभाषित कर रहे हैं।\n\n"
        },
        "$:/language/Help/clearpassword": {
            "title": "$:/language/Help/clearpassword",
            "description": "",
            "text": "बाद के crypto कार्यों के लिए पासवर्ड साफ़\n\n`` `\n--clearpassword\n`` `"
        },
        "$:/language/Help/default": {
            "title": "$:/language/Help/default",
            "description": "",
            "text": "\\define commandTitle()\n$:/language/Help/$(command)$\n\\end\n```\nusage: tiddlywiki [<wikifolder>] [--<command> [<args>...]...]\n```\n\n\nआदेश उपलब्ध:\n\n<ul>\n<$list filter=\"[commands[]sort[title]]\" variable=\"command\">\n<li><$link to=<<commandTitle>>><$macrocall $name=\"command\" $type=\"text/plain\" $output=\"text/plain\"/></$link>: <$transclude tiddler=<<commandTitle>> field=\"description\"/></li>\n</$list>\n</ul>\n\n\nएक आदेश के बारे में विस्तृत मदद पाने के लिए:\ntiddlywiki --help <command>\n```\n"
        },
        "$:/language/Help/editions": {
            "title": "$:/language/Help/editions",
            "description": "",
            "text": "उपलब्ध संस्करणों के नाम और विवरण की सूची देता है। आप `--init` कमांड के साथ एक निर्दिष्ट संस्करण का एक नया विकि बना सकते हैं।\n\n`` `\n--editions\n`` `\n"
        },
        "$:/language/Help/help": {
            "title": "$:/language/Help/help",
            "description": "टिड्लीविकि आदेशों के लिए प्रदर्शन मदद",
