        "$:/language/Help/rendertiddler": {
            "title": "$:/language/Help/rendertiddler",
            "description": "एक निर्दिष्ट ContentType के रूप में एक individual tiddler प्रस्तुत करना",
            "text": "पाठ / html` `करने के लिए, एक निर्दिष्ट ContentType के रूप में चूक एक individual tiddler प्रस्तुत करना है और निर्दिष्ट फ़ाइल नाम करने के लिए इसे बचाने के लिए:\n```\n--rendertiddler <title> <filename> [<type>]\n```\n\nडिफ़ॉल्ट रूप से, फ़ाइल नाम संस्करण निर्देशिका के `output` उपनिर्देशिका के सापेक्ष हल हो गई है। `--output` आदेश एक अलग निर्देशिका के लिए उत्पादन में निर्देशित करने के लिए इस्तेमाल किया जा सकता है।\n\nफ़ाइल नाम करने के लिए रास्ते में किसी भी लापता निर्देशिकाओं स्वचालित रूप से बनाया जाता है।"
        },
        "$:/language/Help/rendertiddlers": {
            "title": "$:/language/Help/rendertiddlers",
            "description": "एक निर्दिष्ट ContentType के लिए एक फिल्टर मिलान tiddlers प्रस्तुत करना",
            "text": "एक text / html` `default to) एक निर्दिष्ट ContentType की फ़ाइलों को अलग करने के लिए एक फिल्टर मिलान tiddlers के सेट और विस्तार के लिए प्रस्तुत करना (` default to .html`)।\n```\n--rendertiddlers <filter> <template> <pathname> [<type>] [<extension>]\n```\n\nउदाहरण के लिए:\n\n```\n--rendertiddlers [!is[system]] $:/core/templates/static.tiddler.html ./static text/plain\n```\n\nडिफ़ॉल्ट रूप से, पथ नाम संस्करण निर्देशिका के `output` उपनिर्देशिका के सापेक्ष हल हो गई है। `--output` आदेश एक अलग निर्देशिका के लिए उत्पादन में निर्देशित करने के लिए इस्तेमाल किया जा सकता है।\n\nलक्ष्य निर्देशिका में किसी भी फाइल को नष्ट कर दिया जाता है। यह मौजूद नहीं है, तो लक्ष्य निर्देशिका बारी बारी से बनाया जाता है।\n"
        },
        "$:/language/Help/savetiddler": {
            "title": "$:/language/Help/savetiddler",
            "description": "",
            "Did you mean": "Saves a raw toddler to a file",
            "text": "निर्दिष्ट फ़ाइल नाम के लिए उसके कच्चे टेक्स्ट या बाइनरी स्वरूप में एक individual tiddler बचाता है।\n```\n--savetiddler <title> <filename>\n```\n\nडिफ़ॉल्ट रूप से, फ़ाइल नाम संस्करण निर्देशिका के `output` subdirectory के के सापेक्ष हल हो गई है। `--output` आदेश एक अलग निर्देशिका के लिए उत्पादन में निर्देशित करने के लिए इस्तेमाल किया जा सकता है।\n\nफ़ाइल नाम करने के लिए रास्ते में किसी भी लापता निर्देशिकाओं स्वचालित रूप से बनाया जाता है।\n"
        },
        "$:/language/Help/savetiddlers": {
            "title": "$:/language/Help/savetiddlers",
            "description": "एक निर्देशिका के लिए raw tiddlers के एक समूह सेव करता है",
            "text": "निर्दिष्ट निर्देशिका के लिए उनके raw टेक्स्ट या बाइनरी स्वरूप में tiddlers के एक समूह की बचत होती है।\n```\n--savetiddlers <filter> <pathname>\n```\n\nडिफ़ॉल्ट रूप से, पथ नाम संस्करण निर्देशिका के `output` subdirectory के के सापेक्ष हल हो गई है। `--output` आदेश एक अलग निर्देशिका के लिए उत्पादन में निर्देशित करने के लिए इस्तेमाल किया जा सकता है।\n\nPathname में किसी भी लापता निर्देशिकाओं स्वचालित रूप से बनाया जाता है।"
        },
        "$:/language/Help/server": {
            "title": "$:/language/Help/server",
            "description": "टिड्लीविकि करने के लिए एक HTTP सर्वर इंटरफेस प्रदान करता है",
            "text": "TiddlyWiki5 करने के लिए बनाया सर्वर बहुत सरल है। हालांकि TiddlyWeb के साथ compatible है मजबूत इंटरनेट का सामना करना यह आवश्यक सुविधाओं के उपयोग के लिए कई का समर्थन नहीं करता।\n\nजड़ में, यह एक निर्दिष्ट tiddler के प्रतिपादन में कार्य करता है। दूर जड़ से, यह JSON में इनकोडिंग व्यक्ति tiddlers कार्य करता है, और `GET`,` PUT` और `DELETE` के लिए बुनियादी HTTP के आपरेशनों का समर्थन करता है।\n\n```\n--server <port> <roottiddler> <rendertype> <servetype> <username> <password> <host> <pathprefix>\n```\n\nThe parameters are:\n\n* ''पोर्ट' '- पोर्ट संख्या (defaults करने से सेवा करने के लिए \"8080\")\n* ''roottiddler'' -\ntiddler रूट पर मदद करने के लिए(defaults to \"$:/core/save/all\") \n* ''rendertype' '- सामग्री प्रकार रूट tiddler प्रदान की जानी चाहिए जो (default to \"text / plain\")\n* ''servetype'' -'rendertype' '- सामग्री प्रकार रूट tiddler प्रदान की जानी चाहिए जो (default to \"text / plain\")\n* ' उपयोगकर्ता नाम '' - संपादन पर हस्ताक्षर करने के लिए डिफाल्ट उपभोक्ता\n* '' पासवर्ड '' - मूलभूत प्रमाणीकरण के लिए वैकल्पिक पासवर्ड\n* ''होस्ट' '- वैकल्पिक होस्टनाम (\"127.0.0.1\" करने के लिए defaults aka \"स्थानीय होस्ट\") से मदद करने के लिए * '' Pathprefix '' - पथ के लिए वैकल्पिक उपसर्ग\nपासवर्ड पैरामीटर निर्दिष्ट किया जाता है, तो ब्राउज़र यूज़रनेम और पासवर्ड के लिए उपयोगकर्ता का संकेत होगा। ध्यान दें। कि इस कार्यान्वयन सामान्य उपयोग के लिए उपयुक्त नहीं है इसलिए पासवर्ड plain text में फैलता है \nउदाहरण के लिए:\n\n```\n--server 8080 $:/core/save/all text/plain text/html MyUserName passw0rd\n```\n\nयूज़रनेम और पासवर्ड खाली तार के रूप में निर्दिष्ट किया जा सकता है: यदि आपको होस्टनाम या पथपरेफिक्ष निर्धारित करने की आवश्यकता है और एक पासवर्ड की आवश्यकता नहीं\n\n```\n--server 8080 $:/core/save/all text/plain text/html \"\" \"\" 192.168.0.245\n```\n\nएक ही समय में कई टिड्लीविकि सर्वरों को चलाने के लिए आप एक अलग पोर्ट पर हर एक डाल करने की आवश्यकता होगी।\n"
        },
        "$:/language/Help/setfield": {
            "title": "$:/language/Help/setfield",
            "description": "उपयोग के लिए बाहरी tiddlers को तैयार",
            "text": "//नोट इस आदेश को प्रयोगात्मक और बदल सकते है  या\nप्रतिस्थापित किया जा रहा है\nअंतिम रूप दिये जाने से  पहले.//\n\nTiddler सेट करने के लिए `currentTiddler` चर के साथ एक टेम्पलेट tiddler wikifying के परिणाम को tiddlers के एक समूह की निर्दिष्ट क्षेत्र सेट करता है।\n\n```\n--setfield <filter> <fieldname> <templatetitle> <rendertype>\n```\n\nThe parameters are:\n\n* ''फिल्टर '' - फिल्टर tiddlers की पहचान के प्रभावित होने की\n* 'FIELDNAME' '- क्षेत्र को संशोधित करने के लिए (defaults \"पाठ\" करने के लिए)\n* ''templatetitle' '- निर्दिष्ट क्षेत्र में wikify को tiddler।रिक्त या फिर लापता तब  क्षेत्र हटाया जाता है\n* ''\nप्रकार '' - टेक्स्ट प्रकार रेंडर करने के लिए (\"टेक्स्ट / plain\" करने के लिए defaults, \"defaults to \"text/html\") html\" एचटीएमएल टैग शामिल करने के लिए इस्तेमाल किया जा सकता है)\n"
