        "$:/language/Modals/Download": {
            "title": "$:/language/Modals/Download",
            "type": "text/vnd.tiddlywiki",
            "subtitle": "Download changes",
            "footer": "<$button message=\"tm-close-tiddler\">Close</$button>",
            "help": "https://tiddlywiki.com/static/DownloadingChanges.html",
            "text": "आपका ब्राउज़र केवल मार्गदर्शन बचत का समर्थन करता है।\n\nअपने संशोधित विकी बचाने के लिए, सही नीचे डाउनलोड लिंक पर क्लिक करें और \"डाउनलोड फ़ाइल\" या \"फ़ाइल सहेजें\" का चयन करें, और उसके बाद फ़ोल्डर और फ़ाइल नाम का चयन करें।\n\n// आप मामूली नियंत्रण कुंजी (Windows) या विकल्प / Alt कुंजी (मैक ओएस एक्स) के साथ लिंक पर क्लिक करके चीजों में तेजी कर सकते हैं। तुम्हें फ़ोल्डर या फ़ाइल नाम के लिए संकेत नहीं दिया जाएगा, लेकिन आपका ब्राउज़र यह एक पहचानने योग्य नाम देने की संभावना है - क्या आप इसके साथ उपयोगी कुछ भी कर सकता से पहले एक `.html` विस्तार शामिल करने के लिए फ़ाइल का नाम बदलने की जरूरत हो सकती .//\n\nविकी सामान्य रूप से बचाया जा सकता है, जहां से एक डेस्कटॉप कंप्यूटर को अपने बुकमार्क सिंक तो फाइलों आप के बजाय लिंक बुकमार्क कर सकते हैं डाउनलोड किया जा करने की अनुमति नहीं है, और है कि smartphones पर।"
        },
        "$:/language/Modals/SaveInstructions": {
            "title": "$:/language/Modals/SaveInstructions",
            "type": "text/vnd.tiddlywiki",
            "subtitle": "Save your work",
            "footer": "<$button message=\"tm-close-tiddler\">Close</$button>",
            "help": "https://tiddlywiki.com/static/SavingChanges.html",
            "text": "इस विकि में आपके परिवर्तन एक ~ टिड्लीविकि HTML फ़ाइल के रूप में सहेजा जाना चाहिए।\n\n!!! डेस्कटॉप ब्राउज़र\n\n# चुनें '' के रूप में सहेजें '' '' फ़ाइल '' मेनू से\n# एक फ़ाइल नाम और स्थान का चयन\n# * कुछ ब्राउज़रों भी आप स्पष्ट रूप से '' वेबपेज, एचटीएमएल केवल '' या इसी तरह के रूप प्रारूप बचत फ़ाइल को निर्दिष्ट करने की आवश्यकता होती है\n# इस टैब बंद करें\n\n!!! स्मार्टफ़ोन ब्राउज़रों\n\n# इस पृष्ठ पर एक बुकमार्क बनाएं\n# * आप iCloud या गूगल सिंक आप इसे खोल सकते हैं जहां फिर बुकमार्क स्वचालित रूप से अपने डेस्कटॉप के लिए सिंक जाएगा और ऊपर के रूप में इसे बचाने के लिए स्थापित मिल गया है\n# इस टैब बंद करें\n\nआप मोबाइल सफारी में फिर से बुकमार्क खोलते हैं // आप फिर से इस संदेश को देखेंगे। तुम आगे बढ़ो और फ़ाइल का उपयोग करना चाहते हैं, तो बस // नीचे '' करीब '' बटन पर क्लिक करें"
        },
